    setText(event.target.value)
  }
  return (
    <>
      <form>
        <h3>Answer this </h3>
        <div>
          <textarea
            value={text}
            onChange={handleChange}
          />
        </div>
        <div>
          <h2 />
          <p>{text}</p>
          <input type='submit' value='Submit' />
        </div>
      </form>
    </>
  )
}
